import React from 'react'
import './Logo.css'
import { Link, navi } from 'react-router-dom'

export default function Logo() {

    const onClick = (e) => {
        e.preventDefault()
    }

return (
<div className='logo'>
    <Link onClick={onClick} to='/'>LogoLogo</Link>
</div>
)
}
